'Cangjie programming language_api_std_math_clamp_float16': 'When using Cangjie Code API, The clamp function clamps a 16-bit floating-point number to a specified range. If the number is within the range, it returns the number; if it is less than the range, it returns the minimum value; if it is greater than the range, it returns the maximum value; if it is NaN, it returns NaN.  
Declaration: public func clamp(v: Float16, min: Float16, max: Float16): Float16'

Code_Example:
import std.math.clamp  
main() {  
    let n: Float16 = 5.0  
    let clamped_value = clamp(n, min: 0.0, max: 10.0)  
    println(clamped_value)  
}

